window.bookSummaryJSON = "<p>When the king of a magical castle ventures into the realm of the dead, creatures of all kinds vie for the throne in the sequel to Castle Perilous.</p> <p>Who will claim the throne now that Lord Incarnadine, King of the Realms Perilous, is dead? Under a mysterious spell cast by a mischief-maker, all of Castle Perilous's 144,000 creatures of curiosity clamor for the crown. Outside of the castle's coveting fray, Gene flies off with an adventurous Amazon in supernatural manifestation and Lord Inky explores the dark mysteries that lurk in the realm of the dead!</p>"; 
